;; **
;;; ## 6.3 (General) Atomic Constraints
;;; 
;;; As described above, atomic constraints have the general form **if @@X@@ then @@C@@**. (Remeber that basic constraints are a special case, were the pattern @@X@@ is empty, intuitively: _if TRUE then @@X@@_)
;;; 
;;; Below is an example for an atomic constraint that is _not_ a basic constraint. A graph satisfies this constraint if (and only if) all `Hello` nodes are connected to a `Grape` node by a `to` edge.
;;; 
;;; As we can see, the pattern that belongs to the "if" part is represented in black colour.
;;; 
;; **

;; @@
(constraint 'if-hello-then-to-grape!
       (pattern (node 'h :label "Hello"))
       (pattern
                (node 'p :label "Grape")
                (edge :src 'h :tar 'p :label "to")))
