;; **
;;; # 7. Transactions 
;;; 
;;; The classical notion of transactions revolves around the ACID (atomic, consistent, isolated, durability) properties. 
;;; 
;;; ## 7.1 Durability
;;; 
;;; Since @@GrapeVine@@ uses a database, all graph productions are automatically made durable. However, not all graphs may be of interest. Moreover, identifying graphs with automatically generated IDs is inconvenient. 
;;; 
;;; Graphs can therefore be tagged with semantic names using the `commit` form. In the following example, we tag the resulting graph with the name "_mygraph_"
;;; 
;;; > **Note: `commit` takes a Grape but will commit only the first graph in the enumeration, if there are multiple.**
;;; 
;; **

;; @@
(-> (newgrape) hello world vine)
(commit _ "mygraph")
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-string'>&quot;a58b14f2-d27a-445a-8083-d6febd2f1e46&quot;</span>","value":"\"a58b14f2-d27a-445a-8083-d6febd2f1e46\""}
;; <=

;; **
;;; Once tagged, we can simply call the `graph` form to recall the graph by its semantic name, for example:
;; **

;; @@
(-> (grape "mygraph") view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"191\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7706fd5f \"BufferedImage@7706fd5f: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@369bd52c transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 191 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x7706fd5f \"BufferedImage@7706fd5f: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@369bd52c transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 191 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 191, :height 251})"}
;; <=

;; **
;;; The names given to graphs using the commit form must be unique. Trying to tag another graph with the same name will result in an error:
;; **

;; @@
(-> (newgrape) hello (commit "mygraph"))
;; @@
;; ->
;;; Caught exception: org.neo4j.driver.exceptions.ClientException: Node(175) already exists with label `__Graph` and property `tag` = &#x27;mygraph&#x27;
