;; **
;;; # 8. Control structures
;;; 
;;; Since @@GrapeVine@@ is embedded into Clojure, all the regular Clojure control structures are available to program with graph transformations. We have already seen that the Clojure _threading macro_ **(->)** is well-suited for **sequential composition** of graph productions, tests and queries.  
;;; 
;;; The other two common concerns are **parallel composition** of productions and conditional **looping** behaviour. While these behaviours can readily be programmed in Clojure, the host language does not provide convenient macros similar to the threading macro *(->)* we used for *sequential composition*.
;;; 
;;; For convenience @@GrapeVine@@ therefore defines a form for **parallel composition** of graph productions **(||)** and a form for conditional **looping** behaviour **(->*)**.
;;; 
;;; Consider the well-known [Wolf-Goat-Cabbage (well, Wolf-Goat-Grape problem)](https://en.wikipedia.org/wiki/Wolf,_goat_and_cabbage_problem) as an example.
;;; 
;;; ![](https://www.mathworks.com/matlabcentral/mlc-downloads/downloads/submissions/55054/versions/1/screenshot.gif)
;;; 
;;; Below is specification of the problem. Rule `setup-ferryman` creates the starting situation. The ferryman can either take one item to the other side  (rule `ferry_one_over`) or he can cross without cargo (rule `cross_empty`). 
;;; 
;;; Then we have defined three graph queries. Two queries for testing the dangerious situations (wolf can eat goat or goat can eat grape) and one test to check whether we have solved the ridle (all on the other side).
;; **

;; @@
(list 
 
(rule 'setup-ferryman
  :create
  (pattern
    (node 'tg :label "Thing" :asserts {:kind "'Goat'"})
    (node 'tc :label "Thing" :asserts {:kind "'Grape'"})
    (node 'tw :label "Thing" :asserts {:kind "'Wolf'"})
    (node 's1 :label "Side" :asserts {:name "'This side'"})
    (node 's2 :label "Side" :asserts {:name "'Other side'"})
    (node 'f  :label "Ferry")
    (edge :label "is_at" :src 'tg :tar 's1)
    (edge :label "is_at" :src 'tc :tar 's1)
    (edge :label "is_at" :src 'tw :tar 's1)
    (edge :label "is_at" :src 'f :tar 's1)
    ))

(rule 'ferry_one_over
  :read
  (pattern :iso
    (node 's1 :label "Side")
    (node 's2 :label "Side")
    (node 'f :label "Ferry")
    (node 't :label "Thing")
    (edge 'et :label "is_at" :src 't :tar 's1)
    (edge 'e :label "is_at" :src 'f :tar 's1))
  :delete ['e 'et]
  :create
  (pattern
    (edge :label "is_at" :src 'f :tar 's2)
    (edge :label "is_at" :src 't :tar 's2)))

(rule 'cross_empty
  :read
  (pattern :iso
    (node 's1 :label "Side")
    (node 's2 :label "Side")
    (node 'f :label "Ferry")
    (edge 'e :label "is_at" :src 'f :tar 's1))
  :delete ['e ]
  :create
  (pattern
    (edge :label "is_at" :src 'f :tar 's2)))

(constraint 'wolf-can-eat-goat! []
  (pattern 
           (node 't1 :label "Thing" :asserts {:kind "'Wolf'"})
           (node 't2 :label "Thing" :asserts {:kind "'Goat'"})
           (node 's :label "Side")
           (node 's2 :label "Side")
           (edge :label "is_at" :src 't1 :tar 's)
           (edge :label "is_at" :src 't2 :tar 's)
           (node 'f :label "Ferry")
           (edge :label "is_at" :src 'f :tar 's2)))

(constraint 'goat-can-eat-grape! []
  (pattern 
           (node 't1 :label "Thing" :asserts {:kind "'Grape'"})
           (node 't2 :label "Thing" :asserts {:kind "'Goat'"})
           (node 's :label "Side")
           (node 's2 :label "Side")
           (edge :label "is_at" :src 't1 :tar 's)
           (edge :label "is_at" :src 't2 :tar 's)
           (node 'f :label "Ferry")
           (edge :label "is_at" :src 'f :tar 's2)))

(constraint 'all_on_the_other_side! []
  (pattern
           (node 'tg :label "Thing" :asserts {:kind "'Goat'"})
           (node 'tc :label "Thing" :asserts {:kind "'Grape'"})
           (node 'tw :label "Thing" :asserts {:kind "'Wolf'"})
           (node 's2 :label "Side" :asserts {:name "'Other side'"})
           (edge :label "is_at" :src 'tg :tar 's2)
           (edge :label "is_at" :src 'tc :tar 's2)
           (edge :label "is_at" :src 'tw :tar 's2)))
)

