;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; As we can see, the program does indeed terminate and returns an empty grape (no solution). The reason for this is that the @@GrapeVine@@ looping macro compares graphs in the graph process for previously seen graphs and does not further explore graphs that are identical (up to isomorphism) with graphs that have been seen before.
;;; 
;;; Let's have a look at the graph process for the above program:
;; **

;; **
;;; 
;; **

;; @@
(def start (-> (newgrape) setup-ferryman))
(->* start all_on_the_other_side!
         ferry_one_over*
         wolf-can-eat-goat!-
         goat-can-eat-grape!-)
(viewproc start)
