;; **
;;; Indeed, there are three possible "cargo" moves of the ferry from the initial state. Two of them are "unsafe" and one of the (transporting the goat) is safe. From there, the only possible move is to transport the goat again. At that point, the resulting graph is identical to the start (up to isomorphism). 
;;; 
;;; > *Note: graphs that appear identical (up to isomorphism) are represented with "_barred_" ovals and are connected with a dashed line to the earlier identical graph in the visualization*
;;; 
;;; Let's look at the graph process of the original program again (which _has_ a solution). Below we see that the breadth-first search does not explore graphs that have already been seen on the process (up to isomorphism).
;; **

;; @@
(-> (newgrape) setup-ferryman
    (->* all_on_the_other_side!
         (|| ferry_one_over* cross_empty*)
         wolf-can-eat-goat!-
         goat-can-eat-grape!-))

(viewproc _)
